import React from "react";
//import "../styles/Header.css";

// By importing the Header.css file, it is added to the DOM whenever this component loads

const styles = {
  heading: {
    background: "red",
    margin: "0",
    paddingTop: "200",
    color: "white",
    fontSize: "225px",
    textAlign: "center"
  }
};


function Header() {
  return (
    <header style={styles.heading}>
      Welcome
    </header>
  );
}

export default Header;
